import Permissions from 'security/permissions';

const permissions = Permissions.values;

const privateRoutes = [{
        path: '/',
        loader: () => import('./dashboard/DashboardPage'),
        permissionRequired: null,
        exact: true
    }, {
        path: '/profile',
        loader: () => import('./auth/ProfileFormPage'),
        perimissionRequired: null,
        exact: true
    }
].filter(Boolean);

const publicRoutes = [{
        path: '/auth/signin',
        loader: () => import('./auth/SigninPage')
    // }, {
    //     path: '/auth/signup',
    //     loader: () => import('./auth/SignupPage')
    }
].filter(Boolean);

const simpleRoutes = [{
        path: '/403',
        loader: () => import('./shared/errors/Error403Page')
    }, {
        path: '/500',
        loader: () => import('./shared/errors/Error500Page')
    }, {
        path: '/**',
        loader: () => import('./shared/errors/Error404Page')
    }
].filter(Boolean)

export default {
    publicRoutes,
    privateRoutes,
    simpleRoutes
}
